/**
 * @param {number[]} nums
 * @return {number}
 */
let findMaxLength = function(nums) {
    let max = 0;
    for (let left = 0; left < nums.length; left++) {
        let zeros = 0, ones = 0, maxCont = 0;
        for (let right = left; right < nums.length; right++) {
            if (nums[right] === 0) {
                zeros++;
            }
            if (nums[right] === 1) {
                ones++;
            }
            if (zeros === ones) {
                maxCont = right - left + 1;
                if (maxCont > max) {
                    max = maxCont;
                }
            }
        }
    }

    return max;
};

